import React, { useState, useEffect } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { Container, TextField, Button, Grid } from '@mui/material';
import GoogleLogin from 'react-google-login';
import FacebookLogin from 'react-facebook-login';
import { gapi } from 'gapi-script';
import './LoginScreen.css';

const LoginScreen = () => {
  const history = useHistory();
  const clientId = '305558011392-5v1b1fnjvaijkbeclfadnu4bqfim1f8l.apps.googleusercontent.com'; // Replace with your Google Client ID

  useEffect(() => {
    gapi.load('auth2', () => {
      gapi.auth2.init({ client_id: clientId });
    });
  }, [clientId]);

  const [userLocation, setUserLocation] = useState(null);

  const handleGoogleLoginSuccess = (response) => {
    const userData = {
      name: response.profileObj.name,
      email: response.profileObj.email,
      profilePicture: response.profileObj.imageUrl,
    };

    if ("geolocation" in navigator) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const location = { latitude: position.coords.latitude, longitude: position.coords.longitude };
          setUserLocation(location);
          history.push({
            pathname: '/LoginSuccess',
            state: { user: userData, location: location },
          });
        },
        (error) => {
          console.error('Error getting location:', error);
          history.push({
            pathname: '/LoginSuccess',
            state: { user: userData },
          });
        }
      );
    } else {
      console.error('Geolocation is not supported by this browser.');
      history.push({
        pathname: '/LoginSuccess',
        state: { user: userData },
      });
    }
  };

  const handleGoogleLoginFailure = (response) => {
    console.log(response);
  };

  const handleFacebookLogin = (response) => {
    console.log(response);
  };

  const handleFacebookLoginFailure = (response) => {
    console.log(response);
  };

  const buttonStyle = {
    backgroundColor: 'rgb(215, 56, 55)',
    color: 'white',
    marginTop: '10px',
    padding: '10px 20px',
    borderRadius: '4px',
    fontWeight: 'bold',
    cursor: 'pointer',
    width: '100%',
  };

  return (
    <div>
      <div className="login-screen-content">
        <Container maxWidth="xs">
          <Grid container spacing={2} justifyContent="center" alignItems="center" className="login-form-container">
            <Grid item xs={12}>
              <div style={{ padding: '20px', borderRadius: '8px', boxShadow: '0px 2px 10px rgba(0, 0, 0, 0.1)' }}>
                <h2 style={{ textAlign: 'center' }}>Login</h2>
                <TextField label="Email" variant="outlined" fullWidth />
                <TextField label="Senha" type="password" variant="outlined" fullWidth style={{ marginTop: '10px' }} />
                <Button variant="contained" color="secondary" fullWidth style={{ ...buttonStyle, marginTop: '20px' }}>
                  Login
                </Button>
                <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginTop: '20px' }}>
                  <Link to="/cadastro" style={{ textDecoration: 'none', marginBottom: '10px', width: '100%' }}>
                    <Button variant="contained" color="secondary" style={buttonStyle}>
                      Criar uma conta
                    </Button>
                  </Link>
                  <div style={{ display: 'flex', alignItems: 'center', width: '100%', marginBottom: '10px' }}>
                    <GoogleLogin
                      clientId="305558011392-5v1b1fnjvaijkbeclfadnu4bqfim1f8l.apps.googleusercontent.com"
                      onSuccess={handleGoogleLoginSuccess}
                      onFailure={handleGoogleLoginFailure}
                      buttonText="Google"
                    />
                    <div style={{ width: '10px' }} />
                    <FacebookLogin
                      appId="YOUR_FACEBOOK_APP_ID" // Replace with your Facebook App ID
                      onSuccess={handleFacebookLogin}
                      onFailure={handleFacebookLoginFailure}
                      buttonText="Facebook"
                    />
                  </div>
                </div>
              </div>
            </Grid>
          </Grid>
        </Container>
      </div>
    </div>
  );
};

export default LoginScreen;
